getJSON('https://sysinfo.' + input)
    .then(obj => {
        if (obj) {
            if (obj.error) {
                print('not found')
                return
            }
            print(`{g}SysInfo for {/}{b}${input}{/}`)
            for (let key in obj) {
                let value = obj[key]
                if (typeof value === 'object') {
                    print(`{y}${key}{/}:`)
                    for (let key_ in value) {
                        let value_ = value[key_]
                        if (typeof value_ === 'object') {
                            print(`{y}${key_}{/}`)
                            for (let key__ in value_) {
                                let value__ = value_[key__]
                                print(`{p}${key__}{/}: {r}${value__}{/}`)
                            }
                        } else if (value_) {
                            print(`{g}${key_}{/}: {r}${value_}{/}`)
                        }
                    }
                } else {
                    print(`{y}${key}{/}: {g}${value}{/}:`)
                }
            }
        }
        else {
            print('not found');
        }
    })
    .catch(print.error);
